import './App.css';
import { Route, BrowserRouter as Router, Switch, NavLink } from "react-router-dom"
import Home from "./components/Home"

function App() {
  return (
    <div className="App">

        <nav className="navbar">
          <NavLink className="links" to="/">Home</NavLink>
        </nav>
        <Switch>
          <Route exact path="/">
            <Home/>
          </Route>
        </Switch>

    </div>
  );
}

export default App;
